import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';

function App(): any {


  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />

        <Route path='/conta' element={
          <h1>Conta</h1>
        }/>

      </Routes>
    </BrowserRouter>   
  );
}

export default App;
